●ムダな装飾を一切そぎ落とし、空間に美しくスッキリなじむシンプルデザインです。<br><br>●ブラシは、ほどよい硬さと弾力性をもったウエーブ形状で、落ちにくい細かな場所の汚れもしっかり捉えます。<br><br>●グリップ部は握りやすく、すべりにくい設計です。<br><br>●デザインアクセントでもある上面のくぼみをつまめば、ケースを楽に持ち上げられます。<br><br>●トレーは取り外して洗うことができ、収納時ブラシはトレーに接しないので、いつも清潔です。<br><br>●2008年グッドデザイン賞を受賞しています。<br><br><table width="500" border="0" align="left" cellpadding="3" cellspacing="1" bgcolor="#CCCCCC" style="font-size:13px; color:#333333;"><tr bgcolor="#FFFFFF"><td width="58">サイズ</td><td>約幅10×奥行10×高さ39（cm）　</td></tr><tr bgcolor="#FFFFFF"><td width="58">材質</td><td>本体・仕切板・水受け皿/ABS樹脂<br>ブラシ柄/ポリプロピレン<br>ブラシ毛/ポリエステル　</td></tr><tr bgcolor="#FFFFFF"><td width="58">重量</td><td>約430g</td></tr><tr bgcolor="#FFFFFF"><td width="58">カラー</td><td>ホワイトブラック</td></tr><tr bgcolor="#FFFFFF"><td width="58">生産国</td><td>日本</td></tr><tr bgcolor="#FFFFFF"><td width="58">セット内容</td><td>ブラシ1本、ケース1個</td></tr></td></tr></table><style type="text/css">
