【クイックルワイパー ハンディ 取り替え用シートの詳細】<br>
●サッとなでるだけ、360度瞬間キャッチ！<br>
●毛先が長くなった吸着センイが凸凹、すき間の奥のホコリ・花粉・ハウスダストをかきとり、からめとって離さない。<br>
●TVまわり、本棚、小物の間、サッシの溝など、家中をスイスイきれいにできます。<br>●「クイックルワイパー ハンディ」、「クイックルワイパー ハンディ 伸び縮みタイプ」どちらにもお使いいただけます。<br><br>

【用途】<br>
住宅用・家具用・自動車車内用 <br><br>

【使用方法】<br>
●ハンディシートをヘッドにかぶせます。シートの端の穴（切込み）に道具のフックを通して固定してください。<br>
●ハンディシートの先端部が汚れてきたら、先端と持ち手側を逆さに付け替えれば、全面を無駄なく使えます。<br>
※汚れたり、ホコリがとれにくくなったら新しいハンディシートに取り替えてください。<br><br>

【ご注意】<br>
○用途外に使わない。<br>
○軽くなでるようにふく。<br>
○ハンディシートは洗って使えない。<br>
○砂粒や硬いごみがハンディシートに付着した状態で使わない。（液晶画面や家具などを傷つける恐れがある。）<br>
○ハンディシートは吸水性がないので、ぬれた所には使わない。<br>
○表面がザラザラした所や、木のささくれた所には使わない。ハンディシートの繊維が抜けることがある。<br>
○車のボディには使わない。車の表面に付着した砂粒や硬いごみで傷がつく恐れがある。<br>
○電球など、高温になっている物は電源を切り、冷えた状態で使う。（高温時に使用すると、溶ける恐れがある。）<br>
○静電気でホコリがとれにくくなることがあるので、テレビなどは電源を切ってから使う。<br>
○直射日光を避け高温の所に置かない。変色や変形する恐れがある。<br>
○白木、ビニール製の床・家具などの上に長期間置いたままにしない。変色することがある。<br>
○使用する際、力を入れすぎない。道具が破損する恐れがある。<br>
○道具が入らないすき間には無理に押し込まない。ハンディシートがはずれたり道具が破損することがある。はずれる場合は輪ゴムなどでしっかり固定する。<br>
○道具（柄）が汚れた時は水ぶきし、日陰で乾かす。汚れがひどい時は、水ぶきの前に中性洗剤をうすめた液でふく。 <br><br>

【大きさ】<br>
約170mm×約85mm<br><br>

【材質】<br>
ポリエチレン、ポリエステル、ポリプロピレン<br><br>

【成分】<br>
流動パラフィン<br><br>

【内容量】<br>
3枚<br><br>

【販売元】<br>
花王株式会社<br>
東京都墨田区文花2-1-3<br>
お電話：0120-165-693<br><br>

【商品区分】<br>
日用品<br><br>

