●気付いた時にサッときれい。廊下の尿モレ、手すりの手アカ、テーブルの食べこぼしに。<br>
●汚れをふきとるだけで、消臭・除菌が1度に！<br>
●丈夫でやぶれにくく、汚れをからめとるメッシュタイプだから、1枚でしっかりキレイ。<br>
●洗浄成分たっぷりだから、汚れがするんと落ちる。<br>
●尿臭ブロッカー配合で尿臭までスッキリ。<br>
●99％除菌。<br>
●さわやかなハーブの香り。<br><br>

【用途】<br>
●床（フローリング、ビニール床）、畳の足跡や尿もれなどの汚れに<br>
●テーブルや食卓などのベタベタした食べこぼし汚れに<br>
●家具、戸棚、窓ガラス、鏡、ドア、ドアノブなどの手垢汚れに<br><br>

