水ぶきできないもの（水がしみ込む白木や家具、壁材等）・トイレ（ポータブルも含む）・うるし塗り・銅・しんちゅう製品・液晶画面・プラズマディスプレイの画面・革製品 <br><br>

【使用方法】<br>
●必ず使用前に使い方と使用上の注意をよく読むこと<br>
１．ボトルのキャップを回して開け、 封シールをはがして取り去る。<br>
２．ロールの中央部からシートの先端をつまみながら引っ張る。<br>
３．シートの先端をキャップ中央の穴に内側から外側に通す。<br>
４．キャップをしっかりと閉めてから使用する。使用後は必ずフタを閉める。<br>
※つめかえる時には、必ず「クイックル 消臭ストロング 除菌おそうじシート」のつめかえ用をご利用ください。<br><br>

【ご注意】<br>
○用途外に使わない。<br>
○人に対して使用しない。<br>
